let parent = document.getElementById("parent");
const products = [
    {
        imageURL: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXVbeQIpjm7cGJ76YtzILTZpHGekpIQ0GS0w&s",
        id: 1,
        name: "Sooper Biscuit",
        price: "$100",
        desc: "Made with pure milk and egg with some love that makes our biscuit to the next level."
    },
    {
        imageURL: "data:image/jpeg;base64,",
        id: 2,
        name: "Knor Chatpatta Noodles",
        price: "$80",
        desc: "Made with pure milk and egg with some love that makes our biscuit to the next level."
    },
    {
        imageURL: "data:image/jpeg;base64,",
        id: 3,
        name: "Dairy Milk Chocolate",
        price: "$180",
        desc: "Made with pure milk and egg with some love that makes our biscuit to the next level."
    },
    {
        imageURL: "data:image/jpeg;base64,",
        id: 4,
        name: "Chocolate Pakola Milk",
        price: "$120",
        desc: "Made with pure milk and egg with some love that makes our biscuit to the next level."
    }
]

let demodata = products.map((x)=>{
    return{
        imageURL: x.imageURL,
        id: x.id,
        name: x.name,
        price: x.price,
        desc: x.desc
    }
});

function render() {
    parent.innerHTML = "";

    demodata.forEach((x) => {
        let mycard = document.createElement("div");
        mycard.innerHTML = `
            <div class="card me-5 mb-5" style="width: 18rem;">
                <img src="${x.imageURL}" class="card-img-top" style="height: 14rem;" alt="...">
                <div class="card-body">
                    <h5 class="card-title">${x.name}</h5>
                    <h5 class="card-title">${x.price}</h5>
                    <p class="card-text">${x.desc}</p>
                    <button class="btn btn-danger" data-id="${x.id}">Delete</button>
                </div>
            </div>
        `;
        parent.appendChild(mycard);
    });

    let allbtn = document.querySelectorAll(".btn");
    allbtn.forEach((b) => {
        b.addEventListener("click", () => {
            demodata = demodata.filter((x) => x.id !== parseInt(b.getAttribute("data-id"))); 
            render();
        });
    });
}





render();